export class PluginManager {
    constructor() {
        this._plugins = [];
    }
    register(plugin) {
        this._plugins.push(plugin);
    }
    registerPlugins(config) {
        if (!config.plugins)
            return;
        for (const plugin of config.plugins) {
            this.register(plugin);
        }
    }
    getPlugins() {
        return this._plugins;
    }
}
